import React from 'react'
import { Form } from 'protected-aidaforms';
import json from './InitialEvaluation.js';
import UtenteDataService from "../services/tutorial.service";
import { withRouter } from '../common/with-router';

class Avininum extends Component {
  constructor(props) {
    super(props);
    this.onChangenome_utente = this.onChangenome_utente.bind(this);
    this.onChangeDescription = this.onChangeDescription.bind(this);
    this.getUtente = this.getUtente.bind(this);
    this.updatePublished = this.updatePublished.bind(this);
    this.updateUtente = this.updateUtente.bind(this);
    this.deleteUtente = this.deleteUtente.bind(this);

    this.state = {
      currentUtente: {
        num_sequencial: null,
        sexo: "",
        nome_utente: "", 
        data_nascimento: new Date()
      },
      message: ""
    };
  }

  componentDnum_sequencialMount() {
    this.getUtente(this.props.router.params.num_sequencial);
  }

  onChangenome_utente(e) {
    const nome_utente = e.target.value;

    this.setState(function(prevState) {
      return {
        currentUtente: {
          ...prevState.currentUtente,
          nome_utente: nome_utente
        }
      };
    });
  }

  onChangeSexo(e) {
    const sexo = e.target.value;
    
    this.setState(prevState => ({
      currentUtente: {
        ...prevState.currentUtente,
        sexo: sexo
      }
    }));
  }

  getUtente(num_sequencial) {
    UtenteDataService.get(num_sequencial)
      .then(response => {
        this.setState({
          currentUtente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

/*

  updatePublished(status) {
    var data = {
      num_sequencial: this.state.currentUtente.num_sequencial,
      nome_utente: this.state.currentUtente.nome_utente,
      description: this.state.currentUtente.description,
      published: status
    };

    UtenteDataService.update(this.state.currentUtente.num_sequencial, data)
      .then(response => {
        this.setState(prevState => ({
          currentUtente: {
            ...prevState.currentUtente,
            published: status
          }
        }));
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }
*/

  updateUtente() {
    UtenteDataService.update(
      this.state.currentUtente.num_sequencial,
      this.state.currentUtente
    )
      .then(response => {
        console.log(response.data);
        this.setState({
          message: "A ficha de utente foi atualizada com sucesso!"
        });
      })
      .catch(e => {
        console.log(e);
      });
  }

  deleteUtente() {    
    UtenteDataService.delete(this.state.currentUtente.num_sequencial)
      .then(response => {
        console.log(response.data);
        this.props.router.navigate('/utente');
      })
      .catch(e => {
        console.log(e);
      });
  }

  render() {
    const { currentUtente } = this.state;
  
  return (
    <Form
      onSubmit={(values, changedFields) => console.log("SUBMITTED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onSave={(values, changedFields) => console.log("SAVED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onCancel={status => console.log("CANCELLED:", status)}
      template={json}
      dlm={{}}
      showPrint={true}
      editMode={true}
      professionalTasks={["Registar Pedido", "Consultar Pedido", "Anular Pedido"]}
      canSubmit={true}
      canSave={true}
      canCancel={true}
      patientData={{
        "numSequencial": currentUtente.num_sequencial,
        "episodio": 21016848,
        "modulo": "INT",
        "processo": 99998888,
        "nome": currentUtente.nome,
        "dtaNascimento": currentUtente.data_nascimento,
        "idade": 77,
        "sexo": "Masculino"
      }}
      reportData={{
        dtaEncerrada: "22-05-2019 13:02",
        dtaCriada: "10-05-2019 18:47",
        realizada: "Joana Pascoal",
        responsavel: "José Costa"
      }}
      referenceModel={[
        {
          "itemName": "Número mecanográfico",
          "item": "num_mecanografico",
          "value": "123456",
          "formVisible": true
        },
        {
          "itemName": "Número sequencial",
          "item": "num_seq",
          "value": currentUtente.num_sequencial,
          "formVisible": true
        },
        {
          "itemName": "Nome",
          "item": "Nome",
          "value": currentUtente.nome_utente,
          "formVisible": true
        }
      ]}
      submitButtonDisabled={false}
      saveButtonDisabled={false}
    />
  );
}
}

export default withRouter(Avininum);
